import React from "react";
import Navbar from './Navbar';
import HowToPlay from './HowToPlay';
import Credits from './Credits';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <h1>nav bar</h1>
          <ul className="nav-links">
            <Link to="/credits">
              <li>Credits</li>
            </Link> 
            <Link to="/howtoplay">
              <li>How To Play!</li>
            </Link>   
          </ul>
        </nav>

        <Switch>
          <Route path="/howtoplay">
            <HowToPlay />
          </Route>
          <Route path="/credits">
            <Credits />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
